'use strict';
let MessageType = require('./MessageType.js');
class HeartbeatMessage {
    numberOfSubscribedSymbols;
    requestId;
    subscribedSymbolsCheckSum;
    constructor() {
        this.numberOfSubscribedSymbols = 0;
        this.requestId = null;
        this.subscribedSymbolsCheckSum = null;
    }
    getType() {
        return MessageType.TestRequestMdt;
    }
    getNumberOfSubscribedSymbols() {
        return this.numberOfSubscribedSymbols;
    }
    getSubscribedSymbolsCheckSum() {
        return this.subscribedSymbolsCheckSum;
    }
    getRequestId() {
        return this.requestId;
    }
}
module.exports = HeartbeatMessage
